            resume: `The code for this exercise implements a wrapper for working with sorted arrays.
Its constructor takes a comparison function that compares two elements and returns a number, negative if the first is less than the second,
zero when they are equal, and positive otherwise (similar to what the sort method on arrays expects).

Rewrite the code to use an ES6 class.
Then, rewrite the loop to use the ES6 array method findIndex, which is like indexOf, but takes a function instead of an element as argument,
and returns the index of the first element for which that function returns true (or returns -1 if no such element was found).
For example [1, 2, 3].findIndex(x => x > 1) yields 1. Use arrow functions for all function expressions.`,
            code: `/*Old way*/
function SortedArray(compare) {
  this.compare = compare
  this.content = []
}
SortedArray.prototype.findPos = function(elt) {
  for (var i = 0; i < this.content.length; i++) {
    if (this.compare(elt, this.content[i]) < 0) break
  }
  return i
}
SortedArray.prototype.insert = function(elt) {
  this.content.splice(this.findPos(elt), 0, elt)
}

var sorted = new SortedArray(function(a, b) { return a - b })
sorted.insert(5)
sorted.insert(1)
sorted.insert(2)
sorted.insert(4)
sorted.insert(3)
console.log("array:", sorted.content)

/*New way*/

class SortedArrayES6{
	constructor(compare){
    	this.compare = compare
      	this.content = []
    }
  
  	findPos(elt){
    	return this.content.findIndex((a) => a > elt)
    }
  
  	insert(elt){
    	this.content.splice(this.findPos(elt), 0, elt)
    }
}

let sortedES6 = new SortedArrayES6((a, b) => a - b)
sortedES6.insert(5)
sortedES6.insert(1)
sortedES6.insert(2)
sortedES6.insert(4)
sortedES6.insert(3)
console.log("array:", sortedES6.content)`
